import React, { useState, useEffect } from 'react';
import Table from 'react-bootstrap/Table';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';;

const SearchDelete = () => {
  const navigate = useNavigate();
  const [employeeId, setEmployeeId] = useState(8);
  const [data, setData] = useState([]);
  const authAxios = axios.create({ baseURL: 'https://departments-a9275-default-rtdb.firebaseio.com/' })

  useEffect(() => {

  fetchData();

  })
  function fetchData(params) {
    authAxios.get('/.json').then((response) => {
      setData(response.data);
    })
  }

  function DeleteById(id) {
    id = id - 1;
    authAxios.delete(`${id}.json`).then((res) => {
      alert("Deleted Successfully");
    }).catch((err)=>{})
  }

  function EditById(id, bol) {
    if (bol) {
      setEmployeeId(employeeId+1)
      navigate('AddEdit', {state : id});

    } else{
      navigate('AddEdit', {state : id});
    }
  }




  return (
    <div>
      <button type="button" onClick={() => EditById(employeeId, true)}  className="btn btn-primary">Update</button>
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>ID</th>
          <th>NAME</th>
          <th>AGE</th>
        </tr>
      </thead>
      <tbody>
        {
          data.map((row) => (
            <tr key={row.ID}>
              <td>{row.ID}</td>
              <td>{row.Name}</td>
              <td>{row.age}</td>
              <td><button type="button" onClick={() => DeleteById(row.ID)}  className="btn btn-danger">Delete</button><button type="button" onClick={() => EditById(row.ID, false)}  className="btn btn-primary">Update</button>
              </td>
            </tr>

          ))}
      </tbody>
    </Table>
    </div>
  );
};

export default SearchDelete;
